Memanggil Wolf Within untuk mengakibatkan <color=#FFACFFFF>Electro DMG</color> ke semua musuh di sekitar. Juga akan menghilangkan semua Electro Sigil milik Razor, yang akan dikonversi menjadi Elemental Energy untuknya.
Wolf Within akan bertempur bersama Razor selama durasi skill.

<color=#FFD780FF>The Wolf Within</color>
·Menyerang bersama dengan Serangan Biasa Razor untuk mengakibatkan <color=#FFACFFFF>Electro DMG</color>;
·Meningkatkan ATK SPD dan <color=#FFACFFFF>Electro RES</color> Razor;
·Membuat Razor kebal terhadap DMG yang diakibatkan oleh efek <color=#FFACFFFF>Electro-Charged</color>;
·Menonaktifkan Charged Attack milik Razor.

Efek-efek ini berakhir saat Razor meninggalkan medan pertempuran.
Saat Razor meninggalkan medan pertempuran, maks. 10 Elemental Energy akan dikembalikan kepadanya berdasarkan durasi yang tersisa dari skill ini.

<i>Sang serigala telah terbangun, pemburuan dimulai.</i>

