Memanggil tetesan air menyerupai not balok yang membentuk sebuah Song Loop, mengakibatkan <color=#80C0FFFF>Hydro DMG</color> ke musuh di sekitar dan memberikan mereka efek <color=#80C0FFFF>Wet</color>.

<color=#FFD780FF>Song Loop</color>
·Normal Attack Barbara memulihkan HP seluruh unit kawan di sekitar dan anggota party, jumlah HP yang dipulihkan berdasarkan Max HP Barbara;
·Charged Attack Barbara memulihkan 4 kali lipat lebih banyak HP;
·Memulihkan sejumlah HP karakter saat ini setiap beberapa waktu;
·Memberikan efek <color=#80C0FFFF>Wet</color> ke karakter dan musuh yang menyentuhnya.

<i>Musik Barbara adalah sihir yang memulihkan teman-temannya.</i>
